import React from 'react';
import onlineSupport from './../Source/OnlineSupport.svg';
import './../App.css';
import Help_CSS from './Help.module.css';
const Help = () => 
{
    return(
      <div className={Help_CSS.help}>
      <img src={onlineSupport} />
      <div className={Help_CSS.supportText}>
     
      </div>
           </div>
    )
}

export default Help;
